import { useState } from 'react';

function Square({ value, onSquareClick }) {
  return (
    <button className="square" onClick={onSquareClick}>
      {value}
    </button>
  );
}

function Board({ xIsNext, squares, onPlay }) {
  function handleClick(i) {
    if (calculateWinner(squares) || squares[i]) {
      return;
    }
    const nextSquares = squares.slice();
    if (xIsNext) {
      nextSquares[i] = 'X';
    } else {
      nextSquares[i] = 'O';
    }
    onPlay(nextSquares);
  }

  const winner = calculateWinner(squares);
  let status;
  if (winner) {
    status = 'Winner: ' + winner;
  } else {
    status = 'Next player: ' + (xIsNext ? 'X' : 'O');
  }

  return (
    <>
      <div className="status">{status}</div>
      <div className="board-row">
        {squares.slice(0, 15).map((value, i) => (
          <Square key={i} value={value} onSquareClick={() => handleClick(i)} />
        ))}
      </div>
      {/* 添加更多的行 */}
      {[...Array(14).keys()].map((_, i) => (
        <div key={i} className="board-row">
          {squares.slice(15 * (i + 1), 15 * (i + 2)).map((value, j) => (
            <Square key={j} value={value} onSquareClick={() => handleClick(15 * (i + 1) + j)} />
          ))}
        </div>
      ))}
    </>
  );
}

export default function Game() {
  const [history, setHistory] = useState([Array(225).fill(null)]);
  const [currentMove, setCurrentMove] = useState(0);
  const xIsNext = currentMove % 2 === 0;
  const currentSquares = history[currentMove];

  function handlePlay(nextSquares) {
    const nextHistory = [...history.slice(0, currentMove + 1), nextSquares];
    setHistory(nextHistory);
    setCurrentMove(nextHistory.length - 1);
  }

  function jumpTo(nextMove) {
    setCurrentMove(nextMove);
  }

  const moves = history.map((squares, move) => {
    let description;
    if (move > 0) {
      description = 'Go to move #' + move;
    } else {
      description = 'Go to game start';
    }
    return (
      <li key={move}>
        <button onClick={() => jumpTo(move)}>{description}</button>
      </li>
    );
  });

  return (
    <div className="game">
      <div className="game-board">
        <Board xIsNext={xIsNext} squares={currentSquares} onPlay={handlePlay} />
      </div>
      <div className="game-info">
        <ol>{moves}</ol>
      </div>
    </div>
  );
}

function calculateWinner(squares) {
  const lines = [
    // 水平线
    ...Array(15).fill().map((_, i) => Array(11).fill().map((_, j) => [i * 15 + j, i * 15 + j + 1, i * 15 + j + 2, i * 15 + j + 3, i * 15 + j + 4])),
    // 垂直线
    ...Array(15).fill().map((_, i) => Array(11).fill().map((_, j) => [i * 15 + j, (i + 1) * 15 + j, (i + 2) * 15 + j, (i + 3) * 15 + j, (i + 4) * 15 + j])),
    // 正斜线
    ...Array(11).fill().map((_, i) => Array(11).fill().map((_, j) => [i * 15 + j, (i + 1) * 15 + j + 1, (i + 2) * 15 + j + 2, (i + 3) * 15 + j + 3, (i + 4) * 15 + j + 4])),
    // 反斜线
    ...Array(11).fill().map((_, i) => Array(11).fill().map((_, j) => [i * 15 + j, (i + 1) * 15 + j - 1, (i + 2) * 15 + j - 2, (i + 3) * 15 + j - 3, (i + 4) * 15 + j - 4])),
  ];
  for (let i = 0; i < lines.length; i++) {
    const [a, b, c, d, e] = lines[i];
    if (squares[a] && squares[a] === squares[b] && squares[a] === squares[c] && squares[a] === squares[d] && squares[a] === squares[e]) {
      return squares[a];
    }
  }
  return null;
}
